String test =
    "";

void main() async {
  Stopwatch timer = Stopwatch();
  var skew = await skewDiagram(test);
  var answer = await minValue(skew);
  print(answer);
  timer.start();
  print([for (var i in answer) i[0]].join(" "));
  timer.stop();
  print("Time elapsed: ${timer.elapsed}");
}

dynamic skewDiagram(String genome) {
  List<dynamic> graph = [];
  int counter = 0;

  for (var i = 0; i < genome.length; i++) {
    if (genome[i] == "C") {
      counter -= 1;
      graph.add([i+1, counter]);
    } else if (genome[i] == "G") {
      counter += 1;
      graph.add([i+1, counter]);
    } else {
      graph.add([i+1, counter]);
    }
  }
  return graph;
}

dynamic minValue(List<dynamic> list) async {
  int minVal = [for (var data in list) data[1]].reduce((cv, v) => v < cv ? v : cv);
  var filter = list.where((data) => data[1] == minVal);
  return filter;
}
